(ns opencv3.trees
(:require
  [opencv3.core :refer :all]
  [opencv3.colors.rgb :as rgb]
  [opencv3.utils :as u]))

; https://stackoverflow.com/questions/31310307/best-way-to-segment-a-tree-in-plantation-aerial-image-using-opencv?rq=1
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@

(def original (-> "resources/images/trees.png" imread))
(def trees
  (-> original clone (cvt-color! COLOR_BGR2HSV)))

(u/mat-view original)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"492\" height=\"374\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x39d255a5 \"BufferedImage@39d255a5: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 492 height = 374 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

