(def in-range-pict
  (new-mat))

(in-range trees (new-scalar 100 80 100) (new-scalar 120 255 255) in-range-pict)
(bitwise-not! in-range-pict)

(u/mat-view in-range-pict)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"492\" height=\"374\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x29e1ace7 \"BufferedImage@29e1ace7: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@55fc79e5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 492 height = 374 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@

(def elem
  (get-structuring-element MORPH_ELLIPSE (new-size 5 5)))
(morphology-ex! in-range-pict MORPH_ERODE elem (new-point -1 -1) 2)
(morphology-ex! in-range-pict MORPH_OPEN elem)

(u/mat-view in-range-pict)
